import React from "react";
export default class Item extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      name: "default",
      price: 0,
      pictureAddress: "/Desktop/e-commerce/e-commerce/pictures/default.png",
    };
  }
  render() {
    return (
      <>
        <image src={this.state.pictureAddress} alt="item" />
        <h3>{this.state.name}</h3>
        <h4>{this.state.price}</h4>
      </>
    );
  }
}
